import axios from "axios";



export const api2 = {

   POST: axios.post('http://localhost:3000/atividades', {
        titulo: 'Ir comprar pão',
        descricao: 'Comprar pão é muito massa',
        data: 'johndoe@example.com',
        hora: 'isso aiiii'
      })
      .then(response => {
        console.log(response.data);
      })
      .catch(error => {
        console.error(error);
      })

}
